import PropTypes from 'prop-types';
import Modal from '../../shared/Modal/Modal';
import Input from '../../shared/Input/Input';

const NewConfigurationModal = props => {
    const {
        isNewConfigurationModalVisible,
        showNewConfigurationModal,
        hideNewConfigurationModal,
        onOkNewConfigurationModal,
        onCancelNewConfigurationModal,
    } = props;

    return (
        <Modal
            isVisible={isNewConfigurationModalVisible}
            showModal={showNewConfigurationModal}
            closeModal={hideNewConfigurationModal}
            onOk={onOkNewConfigurationModal}
            onCancel={onCancelNewConfigurationModal}
            okBtnName={'test'}
            className={'mb-32'}
            title={'test'}
            showClose
            showFooter
        >
            <Input type={'text'} placeholder={'Name'} />
        </Modal>
    );
};

NewConfigurationModal.propTypes = {};

export default NewConfigurationModal;
